function distance(e,t,n,r){var i=e-n;var s=t-r;var o=Math.sqrt(i*i+s*s);return o}function crossProduct(e,t,n){var r=e.x-t.x;var i=e.y-t.y;var s=n.x-t.x;var o=n.y-t.y;var u=r*o-i*s;return u}function grahamScan(e){if(e.length>=3){var t=[{x:e[0].x,y:e[0].y,a:0,d:0}];var n=0;for(var r=1;r<e.length;r++){if(e[r].y<t[0].y){t[0].x=e[r].x;t[0].y=e[r].y;n=r}}for(var r=0;r<e.length;r++){if(r!==n){t.push({x:e[r].x,y:e[r].y,a:Math.atan2(t[0].y-e[r].y,t[0].x-e[r].x),d:distance(e[0].x,e[0].y,e[r].x,e[r].y)})}}function i(e,t){if(e.a<t.a){return-1}else if(e.a>t.a){return 1}else{if(e.d<t.d){return-1}else if(e.d>t.d){return 1}}return 0}t.sort(i);var s=false;while(!s){if(t.length<=3){s=true;break}for(var r=0;r<t.length;r++){var o=r-1;var u=r;var a=r+1;if(o<0){o+=t.length}if(a>t.length-1){u-=t.length}if(a===t.length-1){s=true;break}else{if(crossProduct(t[o],t[u],t[a])>=0){t.splice(u,1);break}}}}return t}else{return e}}